import React from 'react';
import { Grid, Image } from 'semantic-ui-react'

const _SearchMovieListDisplay = (props) => {
    return (
        <React.Fragment>
                <span onClick={props.movieDetails}>
                        <Image onClick={props.movieDetails} src={props.movieImage} className="sizeOfContainerMovieImage" />
                </span>
        </React.Fragment >
    )
}

export default _SearchMovieListDisplay;
